import { Injectable, signal } from '@angular/core';
import { systemConfig } from '@app/core/configs';
import { Permission } from '@app/core/enum';

const authServiceKey = systemConfig.authServiceKey || 'auth';

@Injectable({
  providedIn: 'root',
})
export class AuthService {
  private authorised = signal(false);
  private appAccess = signal(false);

  readonly isAuthorised = this.authorised.asReadonly();
  readonly isAppAccess = this.appAccess.asReadonly();

  constructor() {}

  authCheck() {
    const authorisedUser = JSON.parse(
      localStorage.getItem(authServiceKey) || '{}'
    );
    const isExpired =
      authorisedUser.exp && authorisedUser.exp < Date.now() / 1000;

    if (!isExpired || authorisedUser.exp) {
      // this.permissionsService.addPermission(authorisedUser.roles);
      return this.authorised.set(true);
    }
    this.authorised.set(false);
  }

  flush() {
    this.authorised.set(false);
    this.appAccess.set(false);
    localStorage.removeItem(authServiceKey);
    // this.permissionsService.flushPermissions();
  }

  set auth(data: any) {
    const updatedAuthData = { ...this.auth, ...data };
    localStorage.setItem(authServiceKey, JSON.stringify(updatedAuthData));
    this.authCheck();
  }

  get auth() {
    return JSON.parse(localStorage.getItem(authServiceKey) || '{}');
  }
}

import { Injectable } from '@angular/core';
import { HttpClient } from '@angular/common/http';
import { Observable, of } from 'rxjs';
import { map } from 'rxjs/operators';
import { JwtHelperService } from '@auth0/angular-jwt';

@Injectable({
  providedIn: 'root',
})
export class ClientTokenService {
  private clientReference: any;
  private readonly tokenUrl =
    '/x-api/api/oauth/token?grant_type=client_credentials';

  constructor(private http: HttpClient) {}

  clientToken(): Observable<any> {
    if (this.isTokenValid()) {
      return of(this.clientReference).pipe(
        map(() => this.createAuthHeader(this.clientReference.access_token))
      );
    }

    return this.http.post<any>(this.tokenUrl, {}).pipe(
      map((response) => {
        const helper = new JwtHelperService();
        const decodedToken = helper.decodeToken(response.access_token);
        this.clientReference = response;
        this.clientReference.exp = decodedToken.exp;
        return this.createAuthHeader(this.clientReference.access_token);
      })
    );
  }

  private isTokenValid(): boolean {
    return (
      this.clientReference &&
      this.clientReference.exp - Math.floor(Date.now() / 1000) > 0
    );
  }

  private createAuthHeader(token: string): { Authorization: string } {
    return {
      Authorization: 'Bearer ' + token,
    };
  }
}

import { Injectable } from '@angular/core';

@Injectable({
  providedIn: 'root',
})
export class ClipboardService {
  constructor() {}

  private copyToClipboardFallback(text: string, notificationMsg: string): void {
    const textArea = document.createElement('textarea');
    textArea.value = text;
    document.body.appendChild(textArea);
    textArea.select();
    try {
      document.execCommand('copy');
      // this.notificationService.showNotification(
      //   'Success',
      //   notificationMsg,
      //   'success'
      // );
    } catch (err) {
      console.error('Fallback: Oops, unable to copy', err);
      // this.notificationService.showNotification(
      //   'Error',
      //   'Failed to copy to clipboard.',
      //   'error'
      // );
    }
    document.body.removeChild(textArea);
  }

  async copyToClipboard(text: string, detail?: string): Promise<void> {
    try {
      const notificationMsg = detail
        ? `${detail} copied to clipboard!`
        : 'Text copied to clipboard!';

      if (navigator.clipboard && navigator.clipboard.writeText) {
        await navigator.clipboard.writeText(text);
        // this.notificationService.showNotification(
        //   'Success',
        //   notificationMsg,
        //   'success'
        // );
      } else {
        this.copyToClipboardFallback(text, notificationMsg);
      }
    } catch (err) {
      console.error('Failed to copy text: ', err);
      // this.notificationService.showNotification(
      //   'Error',
      //   'Failed to copy to clipboard.',
      //   'error'
      // );
    }
  }
}

import { Injectable, signal, effect } from '@angular/core';
import { Router } from '@angular/router';

@Injectable({
  providedIn: 'root',
})
export class RegisterRedirectService {
  private registerStepUrl = signal<string | null>(null);

  constructor(private router: Router) {
    effect(() => {
      //   const url = this.redirectUrl();
      //   if (url) {
      //     this.router.navigate([url]);
      //     this.redirectUrl.set(null);
      //   }
    });
  }

  // Method to trigger redirection
  registerStep(data: any) {
    const url = signal<string | null>(null);
    switch (data.state) {
      case 'WAITING_EMAIL_VERIFICATION':
        this.router.navigate(['/register/verify-email', data.registration_id]);
        return true;
      case 'WAITING_PROFILE':
        this.router.navigate(['/register/profile', data.registration_id]);
        return true;
      case 'WAITING_PHONE_NUMBER':
      case 'WAITING_PHONE_NUMBER_VERIFICATION':
      case 'PHONE_NUMBER_VERIFICATION_FAILED':
      case 'PHONE_NUMBER_RECEIVED':
      case 'PHONE_NUMBER_NOT_VALID':
      case 'PHONE_NUMBER_ALREADY_EXISTS':
      case 'VALIDATING_PHONE_NUMBER_VERIFICATION_CODE':
        this.router.navigate(['/register/phone-number', data.registration_id]);
        return true;
      case 'WAITING_PASSWORD':
        // it works with verification id and is not visible in any response
        // so we dont need to navigate the active page
        return true;
      case 'REGISTRATION_COMPLETED"':
        this.router.navigate(['/login']);
        return true;
      case 'INITIALIZED':
      case 'STARTED':
      case 'CONSENT_REQUIRED':
      case 'USER_ALREADY_EXISTS':
        this.router.navigate(['/register']);
        return true;
      default:
        return false;
    }

    this.router.navigate(['/register']);
    this.registerStepUrl.set(data);
  }
}

import { HttpClient, HttpHeaders, HttpParams } from '@angular/common/http';
import { Injectable } from '@angular/core';
import { map, mergeMap, Observable } from 'rxjs';
import { IReqLogin, IResLogin } from '@core/http/register/register.interface';
import { ClientTokenService } from '@shared/services/client-token.service';

@Injectable()
export class RegisterService {
  private readonly signInUrl = 'x-api/api/oauth/token';
  private readonly endpointUrl = `x-api/api/v1/registration`;

  private readonly signInheaders = new HttpHeaders({
    'Content-Type': 'application/x-www-form-urlencoded',
  });

  constructor(
    private http: HttpClient,
    private clientTokenService: ClientTokenService
  ) {}

  signIn(payload: IReqLogin): Observable<IResLogin> {
    const params = new HttpParams({
      fromObject: {
        ...payload,
        grant_type: 'password',
      },
    });

    return this.http.post<IResLogin>(this.signInUrl, params.toString(), {
      headers: this.signInheaders,
    });
  }

  signUp(params: any): Observable<any> {
    return this.clientTokenService
      .clientToken()
      .pipe(
        mergeMap((authHeader) =>
          this.http
            .post<any>(this.endpointUrl, params, { headers: authHeader })
            .pipe(map((response) => response))
        )
      );
  }

  verifyEmail(uuid: string): Observable<any> {
    return this.clientTokenService.clientToken().pipe(
      mergeMap((authHeader) => {
        const url = `${this.endpointUrl}/verify-email?verificationId=${uuid}`;
        return this.http.post<any>(url, {}, { headers: authHeader }).pipe(
          map((response) => {
            return response;
          })
        );
      })
    );
  }
}

