import { Injectable } from '@angular/core';

@Injectable({
  providedIn: 'root',
})
export class StrongPasswordService {
  generateStrongPassword(length: number = 12): string {
    const upperCase = 'ABCDEFGHIJKLMNOPQRSTUVWXYZ';
    const lowerCase = 'abcdefghijklmnopqrstuvwxyz';
    const numbers = '0123456789';
    const specialChars = '!@#$%^&*()_+[]{}|;:,.<>?';
    const allChars = upperCase + lowerCase + numbers + specialChars;

    const getRandom = (chars: string) =>
      chars[Math.floor(Math.random() * chars.length)];

    let password =
      getRandom(upperCase) +
      getRandom(lowerCase) +
      getRandom(numbers) +
      getRandom(specialChars);

    for (let i = password.length; i < length; i++) {
      password += getRandom(allChars);
    }

    return password
      .split('')
      .sort(() => Math.random() - 0.5)
      .join('');
  }
}

import { Injectable } from '@angular/core';

@Injectable({
  providedIn: 'root',
})
export class ThemeService {
  private themeKey = 'app-theme';

  constructor() {
    const theme =
      localStorage.getItem(this.themeKey) === 'dark' ? 'dark' : 'light';
    this.setTheme(theme);
  }

  setTheme(theme: 'light' | 'dark'): void {
    document.documentElement.setAttribute('color-scheme', theme);
    localStorage.setItem(this.themeKey, theme);
  }

  toggleTheme(): void {
    const currentTheme = document.documentElement.getAttribute('color-scheme');
    const newTheme = currentTheme === 'light' ? 'dark' : 'light';
    this.setTheme(newTheme);
  }
}

