import { Component, effect, QueryList } from '@angular/core';
import { RouterModule, Router } from '@angular/router';
import { AuthService } from '@shared/services/auth.service';
import { RegisterService } from '@core/http/register/register.service';
import {
  InputComponent,
  ContainerComponent,
  ButtonComponent,
} from '@shared/components';

import {
  FormGroup,
  FormControl,
  Validators,
  ReactiveFormsModule,
  FormBuilder,
} from '@angular/forms';
import { finalize } from 'rxjs';

@Component({
    selector: 'app-sign-in',
    templateUrl: './sign-in.component.html',
    styleUrl: './sign-in.component.css',
    providers: [RegisterService],
    imports: [
        RouterModule,
        ReactiveFormsModule,
        InputComponent,
        ContainerComponent,
        ButtonComponent,
    ]
})
export class SignInComponent {
  form: FormGroup;
  loading: boolean = false;
  constructor(
    private formBuilder: FormBuilder,
    public authService: AuthService,
    public registerService: RegisterService,
    private router: Router
  ) {
    effect(() => {
      console.log(`IsAuthorised: ${this.authService.isAuthorised}`);
    });
    this.form = this.formBuilder.group({
      username: new FormControl('', [Validators.required]),
      password: new FormControl('', [Validators.required]),
    });
  }

  onSubmit = () => {
    this.loading = true;
    this.registerService
      .signIn(this.form.value)
      .pipe(finalize(() => (this.loading = false)))
      .subscribe((res) => {
        this.router.navigate(['/otp'], {
          queryParams: {
            mfa_id: res.mfa_id,
            expires_in: res.expires_in,
            token_type: res.token_type,
            mfa_channel: res.mfa_channel ?? 'SMS',
            mfa_address: res.mfa_address,
          },
        });
      });
  };
  get f() {
    return this.form.controls;
  }
}

import { Component, effect } from '@angular/core';
import { RouterModule } from '@angular/router';
import { AuthService } from '@shared/services/auth.service';
import { RegisterService } from '@core/http/register/register.service';
import {
  InputComponent,
  ContainerComponent,
  ButtonComponent,
} from '@shared/components';

import {
  FormGroup,
  Validators,
  ReactiveFormsModule,
  FormBuilder,
} from '@angular/forms';
import { finalize } from 'rxjs';

@Component({
    selector: 'app-sign-up',
    templateUrl: './sign-up.component.html',
    styleUrl: './sign-up.component.css',
    providers: [RegisterService],
    imports: [
        RouterModule,
        ReactiveFormsModule,
        InputComponent,
        ContainerComponent,
        ButtonComponent,
    ]
})
export class SignUpComponent {
  form: FormGroup;
  loading: boolean = false;
  constructor(
    private formBuilder: FormBuilder,
    public authService: AuthService,
    public registerService: RegisterService
  ) {
    effect(() => {
      console.log(`IsAuthorised: ${this.authService.isAuthorised}`);
    });
    this.form = this.formBuilder.group({
      email: this.formBuilder.control('', [Validators.required]),
    });
  }

  onSubmit = () => {
    this.loading = true;
    const payload = {
      ...{
        email_address: this.form.value.email,
        client_current_time: new Date().toISOString(),
        consent: true,
        locale: 'en',
      },
    };

    this.registerService
      .signUp(payload)
      .pipe(finalize(() => (this.loading = false)))
      .subscribe((res) => {});
  };

  get f() {
    return this.form.controls;
  }
}

import { Component, EventEmitter, Input, Output } from '@angular/core';

@Component({
  selector: 'app-switch',
  standalone: true,
  templateUrl: './switch.component.html',
  styleUrls: ['./switch.component.css'],
})
export class SwitchComponent {
  @Input() checked: boolean = false;
  @Output() toggled = new EventEmitter<boolean>();

  toggleSwitch(): void {
    this.checked = !this.checked;
    this.toggled.emit(this.checked);
  }
}

